import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import bg from "../assets/car1.jpg";

function Home() {
  const navigate = useNavigate();
  const [pickup, setPickup] = useState(""); // This will show "Current Location" or address
  const [drop, setDrop] = useState("");
  const [loading, setLoading] = useState(false);

  // Get current location
  const getCurrentLocation = () => {
    setLoading(true);
    
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        async (position) => {
          const { latitude, longitude } = position.coords;
          
          // Reverse geocode to get address
          try {
            const response = await fetch(
              `https://nominatim.openstreetmap.org/reverse?format=json&lat=${latitude}&lon=${longitude}`
            );
            const data = await response.json();
            
            const address = data.display_name || "Current Location";
            setPickup(address);
            
            // Store coordinates for later use
            sessionStorage.setItem("currentLocation", JSON.stringify({
              lat: latitude,
              lng: longitude,
              address: address
            }));
            
          } catch (error) {
            console.error("Error getting address:", error);
            setPickup("Current Location");
            
            // Store just coordinates
            sessionStorage.setItem("currentLocation", JSON.stringify({
              lat: latitude,
              lng: longitude,
              address: "Current Location"
            }));
          }
          
          setLoading(false);
        },
        (error) => {
          console.error("Error getting location:", error);
          alert("Please enable location access or enter pickup manually");
          setLoading(false);
        }
      );
    } else {
      alert("Geolocation is not supported by your browser");
      setLoading(false);
    }
  };

  const handleSearch = async () => {
    setLoading(true);
    
    try {
      // Get current location coordinates from session storage
      const currentLocationData = JSON.parse(sessionStorage.getItem("currentLocation") || "{}");
      
      let pickupCoords;
      
      if (currentLocationData.lat && currentLocationData.lng) {
        // Use current location
        pickupCoords = {
          lat: currentLocationData.lat,
          lng: currentLocationData.lng
        };
      } else {
        // Fallback: geocode the pickup address
        const pickupRes = await fetch(
          `https://nominatim.openstreetmap.org/search?format=json&q=${encodeURIComponent(pickup)}`
        );
        const pickupData = await pickupRes.json();
        
        if (pickupData.length > 0) {
          pickupCoords = {
            lat: parseFloat(pickupData[0].lat),
            lng: parseFloat(pickupData[0].lon)
          };
        } else {
          throw new Error("Pickup location not found");
        }
      }
      
      // Get drop coordinates
      const dropRes = await fetch(
        `https://nominatim.openstreetmap.org/search?format=json&q=${encodeURIComponent(drop)}`
      );
      const dropData = await dropRes.json();
      
      if (dropData.length > 0) {
        const dropCoords = {
          lat: parseFloat(dropData[0].lat),
          lng: parseFloat(dropData[0].lon)
        };
        
        // Navigate to map page with coordinates
        navigate("/map", {
          state: {
            pickupLocation: pickupCoords,
            dropLocation: dropCoords,
            pickupAddress: currentLocationData.address || pickup,
            dropAddress: drop
          }
        });
      } else {
        alert("Destination location not found");
      }
    } catch (error) {
      console.error("Error:", error);
      alert("Error finding locations. Please try again.");
    }
    
    setLoading(false);
  };

  return (
    <div>
      {/* NAVBAR */}
      <div style={styles.navbar}>
        <h2 style={styles.logo}>RIDE</h2>
        <div>
          <button style={styles.navBtn}>Book an Cab</button>
          <button style={styles.navBtn}>Free S1 Test Ride</button>
        </div>
      </div>

      {/* HERO */}
      <div style={styles.hero}>
        <img src={bg} style={styles.bg} alt="background" />

        <div style={styles.searchBox}>
          <div style={styles.tabs}>
            <span style={styles.activeTab}>Daily</span>
            <span>Rental</span>
            <span>Outstation</span>
          </div>

          <div style={styles.inputs}>
            <div style={{ flex: 1, position: 'relative' }}>
              <input
                placeholder="Current Location"
                style={styles.input}
                value={pickup}
                onChange={(e) => setPickup(e.target.value)}
              />
              <button 
                onClick={getCurrentLocation}
                style={styles.locationBtn}
                disabled={loading}
              >
                üìç Use Current
              </button>
            </div>

            <input
              placeholder="Enter Destination"
              style={styles.input}
              value={drop}
              onChange={(e) => setDrop(e.target.value)}
            />

            <button 
              style={styles.searchBtn}
              onClick={handleSearch}
              disabled={loading || !drop}
            >
              {loading ? "LOADING..." : "SEARCH CABS ‚Üí"}
            </button>
          </div>
        </div>

        {/* FOOTER */}
        <div style={styles.footer}>
          <div style={styles.footerContainer}>
            <div>
              <h3>RIDE</h3>
              <p>Book cab in seconds</p>
            </div>
            <div>
              <h4>Company</h4>
              <p>About</p>
              <p>Careers</p>
              <p>Contact</p>
            </div>
            <div>
              <h4>Services</h4>
              <p>Daily</p>
              <p>Rental</p>
              <p>Outstation</p>
            </div>
            <div>
              <h4>Support</h4>
              <p>Help</p>
              <p>Terms</p>
              <p>Privacy</p>
            </div>
          </div>
          <div style={styles.copy}>¬© 2026 Ride App. All rights reserved.</div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  navbar: {
    background: "black",
    color: "white",
    padding: "15px",
    display: "flex",
    justifyContent: "space-between"
  },
  logo: {
    margin: 0
  },
  navBtn: {
    marginLeft: "10px",
    padding: "10px",
    border: "none"
  },
  hero: {
    position: "relative"
  },
  bg: {
    width: "100%",
    height: "450px",
    objectFit: "cover"
  },
  searchBox: {
    position: "absolute",
    top: "150px",
    left: "50%",
    transform: "translateX(-50%)",
    background: "white",
    padding: "20px",
    width: "600px",
    borderRadius: "8px",
    boxShadow: "0 5px 20px rgba(0,0,0,0.2)"
  },
  tabs: {
    display: "flex",
    gap: "20px",
    marginBottom: "10px"
  },
  activeTab: {
    borderBottom: "2px solid black",
    paddingBottom: "5px"
  },
  inputs: {
    display: "flex",
    gap: "10px",
    flexDirection: "column"
  },
  input: {
    padding: "12px",
    width: "100%",
    border: "1px solid #ddd",
    borderRadius: "4px",
    fontSize: "14px"
  },
  locationBtn: {
    position: "absolute",
    right: "5px",
    top: "50%",
    transform: "translateY(-50%)",
    background: "#4CAF50",
    color: "white",
    border: "none",
    padding: "5px 10px",
    borderRadius: "4px",
    cursor: "pointer",
    fontSize: "12px"
  },
  searchBtn: {
    background: "black",
    color: "white",
    padding: "12px",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
    fontWeight: "bold",
    width: "100%"
  },
  footer: {
    background: "#111",
    color: "white",
    padding: "40px 20px",
    marginTop: "50px"
  },
  footerContainer: {
    display: "flex",
    justifyContent: "space-around",
    flexWrap: "wrap"
  },
  copy: {
    textAlign: "center",
    marginTop: "20px",
    color: "gray"
  }
};

export default Home;
